const trap = function(height) {
    height.unshift(0);
    let i = 1;
    let carry = 0;
    let ovLeftMax = 0;
    let ovRightMaxIdx = 0;
    while(i < height.length - 1) {
        let currentVal = height[i];
        let leftMax = ovLeftMax;
        let rightMax = height[ovRightMaxIdx];
        let k = i + 1;

        if(i >= ovRightMaxIdx) {
          rightMax = height[k];
          console.log(i)
          //  for faster search: use 2 pointers
          while(k < height.length) {
            if(height[k] >= rightMax) {
              ovRightMaxIdx = k;
            }
            rightMax = Math.max(height[k], rightMax);
            k++
          }
        }
        let min = Math.min(leftMax, rightMax);
        let cc = min - currentVal
        if(cc > 0) {
            carry += cc
        }
        ovLeftMax = Math.max(ovLeftMax, currentVal)
        i++
    }

    return carry
};

